import React, { useEffect } from 'react';

import { useParams } from 'react-router-dom';

const EditP = () => {

    useEffect(() => {
        const { id } = useParams();
        alert(id);
    }, []);

    return (
        <div>Edit Page</div>
    );
}

export default EditP;
